import React, {Component} from 'react';

class ReviewsList extends Component {
    render(){
        const {reviews} = this.props;
        const reviewList = reviews.map(review => {
            return (
                <div>
                    <div>Name: {review.name}</div>
                    <div></div>
                </div>
            );
        })
        return (
            <div>
                { reviewList }
            </div>
        );

    }
}

export default ReviewsList;
